import React from 'react';
import { BrowserRouter as Router } from 'react-router-dom';
import './Work.css';
import PortfolioAssemble from './PortfolioAssemble';


function Work() {

	return(
		<React.Fragment>
			<section className='intro'>
				<p>Hi, I'm Cameron. I'm a Front End Web Developer based in Glasgow, Scotland. That's the short and sweet.</p>
				<p>I'm also bit of a creative multi tool, simultaniously working in graphic, print and branding design, UX/UI as well as running improv Dungeons & Dragons games. Below are some examples of the work I've done, feel free to browse or filter as you see fit. Thanks for stopping by!</p>
			</section>
			<section className='portfolio-container'>
				<Router>
					<PortfolioAssemble />
				</Router>
			</section>
		</React.Fragment>
	);

}

export default Work;
